import './App.css';
import Navbar from './component/Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/popular" element={<Popular />}></Route>
          {/* <Route path="/top" element={<TopRated />}></Route> */}
          {/* <Route path="/detail/:id" element={<Detail />}></Route> */}
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
